import './App.css';

import {  Router, Route ,Switch, Routes} from 'react-router-dom';


import Homepage from './Homepage';
import Nav from './Nav';





export default function App() {
  return (
    <Router>
          <Switch>
            <Route  path="#home" component={Nav} />
            <Route  path="#home" component={Homepage} />

            </Switch>
      </Router>
  )
}
